import React from 'react'
import * as ICON from '../src/components/icons'

export default {
    TABLET_SIZE: 980,
    DESKTOP_SIZE: 1270
  }

export const MENU = [
    {
        key:'twitter',
        logo: <ICON.Twitter />,
        path: '/',
        text: '',

    },
    {
        key:'Home',
        logo: <ICON.Home />,
        path: '/',
        text: 'Home',

    },
    
    {
        key:'Explore',
        logo: <ICON.Explore/>,
        path: '/Explore',
        text: 'Explore',

    },
    {
        key:'Notification',
        logo: <ICON.Notification/>,
        path: '/Notification',
        text: 'Notification',

    },
    {
        key:'Messages',
        logo: <ICON.Messages/>,
        path: '/Messages',
        text: 'Messages',

    },
    {
        key:'Bookmark',
        logo: <ICON.Bookmark/>,
        path: '/Bookmark',
        text: 'Bookmark',

    },
    {
        key:'Lists',
        logo: <ICON.Lists/>,
        path: '/Lists',
        text: 'Lists',

    },
    {
        key:'Profile',
        logo: <ICON.Profile/>,
        path: '/Profile',
        text: 'Profile',

    },
    {
        key:'More',
        logo: <ICON.More/>,
        path: '/More',
        text: 'More',

    },
]
